import { useState } from "react";

const Home = () => {
  const [name, setName] = useState([1, 2, 3, 4, 5, 6, 6, 7, 8]);
  const handleClick = () => {
    setName("Gica");
  };

  return (
    <div className="home">
      <h2>Homepage</h2>

      <button onClick={handleClick} className="home-button">
        Click me
      </button>
      <p> {name} </p>
    </div>
  );
};

export default Home;
